   it('qbinom is inverse to pbinom', function() {
      var o, n, p, i, reps;
      for (reps = 0; reps < 100; reps += 1)
      {
         n = Math.floor(Math.random() * 10 + 20);
         p = Math.random();
         o = main.binom(n, p);
         for (i = 0; i <= n; i += 1) {
            if (i === 0 || i === n) {
               expect(o.q(o.p(i))).to.equal(i);
               expect(o.q(o.p(i, false), false)).to.equal(i);
            } else {
               if (o.p(i) === 1) {
                  expect(o.q(o.p(i))).to.equal(n);
               } else {
                  // console.log("expect with 'large' left")
                  expect(o.q(o.p(i))).to.equal(i);
               }
               if (o.p(i, false) === 1) {
                  expect(o.q(o.p(i, false), false)).to.equal(0);
               } else {
                  // console.log("expect with 'large' right")
                  expect(o.q(o.p(i, false, true), false, true)).to.equal(i);
               }
            }
         }
      }
   });

